description:
Новый электронный кошелёк DC Next, с современным дизайном и новыми возможностями. 
Решайте ваши ежедневные задачи в любом месте, где есть интернет. Просто, удобно, 24/7.

Возможности приложения:
• Отправлять и получать денежные переводы; 
• оплачивать сотовую связь, интернет, ЖКХ и более 200 других услуг;
• переводить деньги мгновенно по номеру телефона;
• отслеживать историю платежей и переводов;
• получать бонусы в кафе и супермаркетах;
• пополнять и отслеживать поездки City Card;
• быстрый поиск и покупка билетов;
• удобный способ покупки лекарств с доставкой на дом;
• перевозка грузов в любую точку мира.

Если вы столкнулись с проблемой в мобильном приложении или у вас появилась идея по улучшению работы мобильного банкинга. Пишите нам: tamos.dc.tj

Никаких очередей, бумаг и выходных. С мобильным приложением Эсхата Онлайн вы можете с любого места и в любое время оплачивать товары и услуги, а также совершать банковские операции в режиме онлайн. 
Группа разработчиков постарались реализовать максимальное удобство и понятный интерфейс для пользователей. Постоянная доработка приложения ведется по всем направлениям: добавляются полезные функции, устраняются мелкие баги, улучшается дизайн интерфейса.

Одной из важных функций приложения это Удаленная идентификация пользователей. Всего 4 шага, и вы становитесь идентифицированным пользователем, которому открываются больше возможностей и лимитов. Но это еще не всё! БАНК ДАРИТ по 5 СОМОНИ, каждому пользователю, прошедшему удаленную идентификацию.

Удобство превыше всего! С Эсхата Онлайн вам не нужно будет искать документы по банковским продуктам или вспоминать о сроке кредита или депозита. Не нужно приходить в Банк для отправки или получения денежного перевода. Всё это можно сделать легко и быстро через мобильное приложение. 

С Эсхата Онлайн вы сможете:
- СМОТРЕТЬ БАЛАНС и историю операций вашего электронного кошелька, сберегательных счетов и банковских карт;
- ПЛАТИТЬ за мобильную связь, коммунальные услуги, образование и многое другое;
- ПЕРЕВОДИТЬ и ПОЛУЧАТЬ денежные переводы внутри и за пределами страны;
- КОНВЕРТИРОВАТЬ валюту;
- ЗАКАЗАТЬ банковскую карту;
- ПОДАТЬ ЗАЯВКУ на получение кредита.

Много нового и полезного:
- QR-оплата в партнерских точках;
- УВЕДОМЛЕНИЯ об операциях и сообщения в удобном формате push;
- КОНСУЛЬТАЦИИ и помощь сотрудников Банка в чате;
- ПРОСМОТР курса валют в режиме реального времени;
- ПОИСКОВИК и удобные фильтры в историях платежей;
- ВИДЖЕТЫ с быстрым переходом часто используемых функций.

Время – бесценно! Берегите свое время с Эсхата Онлайн!

Смотрите кино, мультики, сериалы и ТВ онлайн на всех устройствах: от смартфона до телевизора. Премьеры и блокбастеры из кинотеатров и онлайн-платформ на вашем девайсе!

Откройте интертеймент без границ с VK Видео: онлайн-просмотр ТВ, новинки кино и сериалов, познавательные и развлекательные видео, мультики для детей, эксклюзивный контент и спортивные трансляции ждут вас. 

Смотрите всё и даже больше:
• регулярные громкие премьеры российских и зарубежных фильмов, которые выходят на нашей платформе раньше, чем где-либо;
• сериалы, которые перевернули кинематограф и являются бесспорной классикой, а также трендовые новинки разных жанров, которые ещё предстоит оценить зрителю;
• новые выпуски любимых шоу: «Что было дальше?», «Большое шоу», LAB, «Кажется, нащупал» и другие;
• спортивные трансляции актуальных соревнований;
• семейные фильмы и познавательные мультфильмы для детей;
• огромное количество оригинального контента: шоу «Кстати», ТОП, «Сессия», «Орёл и Орёл» и многие другие;
• любимые ТВ-каналы онлайн и прямые эфиры.

Функции для комфортного просмотра:
• включайте премьеры и блокбастеры на любом устройстве! Начните смотреть любимое шоу в приложении VK Видео, а продолжите — на Smart TV или компьютере;
• если важно смотреть фильмы без звука, просто включите субтитры; 
• смотрите сериалы онлайн без подписки в фоновом режиме, пока занимаетесь своими делами. Фоновое воспроизведение работает даже с выключенным экраном смартфона;
• умный поиск найдёт кино по синонимам и исправит ошибки за вас;

На витрине VK Видео — тысячи роликов, среди которых вы найдёте подходящий контент. Выберите свои интересы среди множества тем, чтобы смотреть только то, что нравится и подходит именно вам! Персональная лента будет обновляться каждый день.

Устанавливайте приложение и наслаждайтесь просмотром. Внутри есть контент для всех:
• мультики для детей;
• фильмы;
• ТВ-каналы;
• спортивные трансляции;
• прямые эфиры;
• шоу;
• сериалы онлайн без подписки;
• ролики блогеров.

А может, вы открыли в себе талант продюсера и режиссёра? Тогда смело снимайте видео и загружайте в свой профиль! 

Смотрите любимые ролики и отправляйте интересный контент друзьям. В VK Видео вас уже ждут фильмы, мультики для детей, ТВ-каналы, свежие ролики, прямые эфиры, спортивные трансляции и сериалы онлайн без подписки.
